// src/App.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';

import './App.css';
import Home from './components/Home';

const App = () =>  {
    return (
        <Router>
            <div className="App">
                <nav className="category-container">
                    <Link className="category-button" to="/clothes">Clothes</Link>
                    <Link className="category-button" to="/electronics">Electronics</Link>
                    <Link className="category-button" to="/sale">Sale</Link>
                </nav>
                <Routes>
                    <Route path="/login" element={<Login/>} />
                    <Route path="/register" element={<Register/>} />
                    <Route path="/home" element={<Home/>} />
                    <Route path="/" element={<h1>"welcome to App"</h1>}/>
                </Routes>
            </div>
        </Router>
    );
};

export default App;
